import React, { Component } from 'react';
import './App.css';
import UserForm from './Components/UserForm';
import Footer from './Components/Footer'

class App extends Component {

  render() {
    return (
      <div className="App">
        <header className="App-header">
        </header>
        <UserForm />
        <Footer />
      </div>
    );

  }
}

export default App;
